import {Grid, Cell} from 'react-mdl';

class Contacts extends React.Component{
    render(){
     return(
        <div>
           <div >
               <Grid>
                <Cell col={12} className='contacts'>
                <h1 className='tc f1 lh-title'>CONTACTS</h1>
                <div>
                </div>
                </Cell>
               </Grid>

           </div>
        </div>
    )
    }
}

export default Contacts;
